import React, { useState } from "react";

import {
  Container,
  Typography,
  Card,
  CardContent,
  CardActions,
  Button,
  Grid,
  Tooltip,
  Badge,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@mui/material";
import NotificationsIcon from "@mui/icons-material/Notifications";
import AddIcon from "@mui/icons-material/Add";

function UserDashboard() {
  const [communications, setCommunications] = useState([
    {
      company: "Company A",
      recentComms: [
        { type: "LinkedIn Post", date: "2023-12-15", notes: "Promoted product X" },
        { type: "Email", date: "2023-12-10", notes: "Requested meeting" },
      ],
      nextComm: { type: "Email", date: "2023-12-27" },
    },
    {
      company: "Company B",
      recentComms: [
        { type: "Phone Call", date: "2023-12-12", notes: "Discussed pricing" },
        { type: "LinkedIn Message", date: "2023-12-09", notes: "Shared company brochure" },
      ],
      nextComm: { type: "LinkedIn Post", date: "2023-12-26" },
    },
  ]);
  const overdueCount = 1; // Example overdue count

  const handleAddCommunication = (companyName) => {
    alert(`Log communication for ${companyName}!`);
  };

  const getRowColor = (date) => {
    const today = new Date().toISOString().slice(0, 10);
    const commDate = new Date(date).toISOString().slice(0, 10);
    if (commDate < today) return "#f8d7da"; // Red for overdue
    if (commDate === today) return "#fff3cd"; // Yellow for due today
    return "#ffffff"; // White for future dates
  };

  return (
    <Container>
      <Grid container alignItems="center" spacing={2} marginBottom={2}>
        <Grid item>
          <Badge
            badgeContent={overdueCount}
            color="error"
            overlap="circular"
            anchorOrigin={{
              vertical: "top",
              horizontal: "right",
            }}
          >
            <NotificationsIcon fontSize="large" />
          </Badge>
        </Grid>
        <Grid item>
          <Typography variant="h4" component="div">
            User Dashboard
          </Typography>
        </Grid>
      </Grid>

      <Paper>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Company Name</strong></TableCell>
              <TableCell><strong>Last Five Communications</strong></TableCell>
              <TableCell><strong>Next Scheduled Communication</strong></TableCell>
              <TableCell align="center"><strong>Actions</strong></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {communications.map((comm, index) => (
              <TableRow key={index} style={{ backgroundColor: getRowColor(comm.nextComm.date) }}>
                <TableCell>{comm.company}</TableCell>
                <TableCell>
                  {comm.recentComms.map((c, i) => (
                    <Tooltip key={i} title={c.notes} arrow>
                      <Typography variant="body2">
                        {c.type} - {new Date(c.date).toLocaleDateString()}
                      </Typography>
                    </Tooltip>
                  ))}
                </TableCell>
                <TableCell>
                  {comm.nextComm.type} - {new Date(comm.nextComm.date).toLocaleDateString()}
                </TableCell>
                <TableCell align="center">
                  <Button
                    variant="contained"
                    color="primary"
                    startIcon={<AddIcon />}
                    onClick={() => handleAddCommunication(comm.company)}
                  >
                    Log Communication
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Container>
  );
}

export default UserDashboard;
